import React, { Component } from "react";
import "./Header.css"; 

class Header extends Component {
    render(){
        return (
            <header id="header">
                <div className="wrapper">
                    <a href="#"
                        onClick={() => this.props.clearSeason}
                    >
                        <h1 >The Library</h1>
                    </a>
                    <p>Read up on all your favourite queens before they read you.</p>
                </div>
            </header>
        )
    }
}

export default Header;
